import ExpenseComponent from "./ExpenseComponent";
function Expense(props){
    
    return (
        <div>
          <h2>Let's get started!</h2>
          <ExpenseComponent title={props.expenses[0].title} amount={props.expenses[0].amount} date={props.expenses[0].date}></ExpenseComponent>
          <ExpenseComponent title={props.expenses[1].title} amount={props.expenses[1].amount} date={props.expenses[1].date}></ExpenseComponent>
          <ExpenseComponent title={props.expenses[2].title} amount={props.expenses[2].amount} date={props.expenses[2].date}></ExpenseComponent>
          <ExpenseComponent title={props.expenses[3].title} amount={props.expenses[3].amount} date={props.expenses[3].date}></ExpenseComponent>
        </div>
      );
}
export default Expense
